sourcesContent:
import styled from "styled-components";

export const Title = styled.h1`
  font-family: arial, helvetica, sans-serif;
  font-size: 50px;
  color: #004d39;
`;
export const Cont = styled.h2`
  font-family: arial, helvetica, sans-serif;
  font-size: 30px;
  color: #99ffe6;
`;
